import React from 'react';
import styled from 'styled-components';
import Illustration from './Illustration';

const TallContainer = styled.div`
  height: 60vh;
  display: block;
`;

const AboutPanelContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
  -webkit-box-pack: justify;
  justify-content: space-between;
  -webkit-box-align: center;
  margin: 0px auto;
  max-width: 1000px;

  @media (max-width: 48em) {
    display: block;
    max-width: 500px;
  }
`;

const AboutPanelTextContainer = styled.div`
  flex: 1;
  max-width: 450px;
`;

const AboutPanelTitle = styled.p`
  font-size: 20px;
  margin-top: 66px;
  font-weight: 400;
`;

const AboutPanelSecondaryText = styled.p`
  font-size: 20px;
  margin-top: 20px;
  color: #666666;
`;

export default function ContactPanel() {
  return (
    <TallContainer>
      <AboutPanelContainer>
        <Illustration />
        <AboutPanelTextContainer>
          <AboutPanelTitle>Get In Touch</AboutPanelTitle>
          <ul>

           </ul>
        </AboutPanelTextContainer>
      </AboutPanelContainer>
    </TallContainer>
  );
}

